import axios from "axios";
import React from "react";


function ProfileItem(){

    axios({
        method: "get",
        url: "http://localhost:8000/api/profile/",
        data: null
    }).then(res => {
      console.log(res.data);
      }).catch(err => {
        console.log(err);
      });
    return (
      <div>Hello</div>
    );

}

export default ProfileItem;
